script: |
  super -f tsv -I q4358.sql | sort > q4358.out

vector: true

inputs:
  - name: q4358.sql
    data: |
      SELECT ALL 58 AS col2 FROM tab1 WHERE NOT ( + - col0 * + ( - ( col2 ) ) + 47 * - col1 ) BETWEEN + col1 / col0 AND - ( - col1 ) / col1;
  - name: tab1

outputs:
  - name: q4358.out
    data: |
      58
      58
      58
